import React from 'react'
import "../Pages/All.css"
import { useNavigate } from 'react-router-dom'

const Navbar = () => {
    const Docs=()=>{
        window.location="/Docs"
    }

    const Home=useNavigate()


    return (
        <>
         <nav className='arkaplanNav'>
            <h3 onClick={()=>Home("/")} className='logo'>MK.app</h3>
            <ul>
                <li>Urun</li>
                <li onClick={Docs}>Dökümanlar</li>
                <li>Fiyatlandırma</li>
                <li>Blog</li>
                <li>Kayıt Olmak</li>
                <li><button className='button1 btn btn-light'>Ücretsiz Başlayın</button></li>

            </ul>
         </nav>


        </>
    )
}

export default Navbar;
